import { styled, Card, Button, CardActions, CardMedia,Typography } from "@mui/material";

export const MyCard = styled(Card)({
  width: "445px",
  height: "450px",
  margin: "20px",
  alignItems: "center",
  backgroundColor: "#735d78",
});

export const MyTypography = styled("p")({
  display: "inline-block",
  overflow: "auto",
  height: "50px",
  fontSize: "12px",
  margin: "0px",
  color: "#dedbd2"
});
export const MyName = styled(Typography)({
  color:"#f7e1d7",
  fontWeight:"bold",
  borderBottom: "2px dotted #f7d1cd",
});

export const MyButton = styled(Button)({
  textTransform: "capitalize"
});

export const MyActions = styled(CardActions)({
  justifyContent: "right",
  paddingRight: "16px",
});

export const MyMedia = styled(CardMedia)({
  objectFit: "contain",
});
